import React from "react";
import { XMarkIcon } from '@heroicons/react/24/outline';

const learnLanguages = [
    "Norsk",
    "Francais",
    "Italiano"
];

const useLanguages = [
    "English"
];

function Login() {
    return(
    <XMarkIcon className="absolute top-6 right-8 h-10 w-10 text-gray-600 cursor-pointer" />
    );
}

function DropDown(props) {
    return (
        <select name="exampleDropdown" id="exampleDropdown">

        {props.list.map((opt) => {
            return(
                <option key={opt}>{opt}</option>
            ) 
        })}

        </select>
    );
}
 
const Home = () => {
    return (
        <div>
            <Login />
            <h1>
                Learn
            </h1>
            <DropDown list={learnLanguages} />
            <h1>
                Using
            </h1>
            <DropDown list = {useLanguages} />
            <button>Launch Chatroom</button>
        </div>
    );
};
 
export default Home;
